R["fx__na__@totes1__13"]="{['Version']=1762,['Effects']={[1]={['Contrast']=1,['SizeX']=26.456456,['EffectType']=8503,['Id']=1076,['Y']=20112,['Pitch']=4.705408,['MetaData']={['message']='Millenia ago, before the seasons took what they had come for, this temple stood grand and proud as testament to a sophisticated civilisation. Having succumbed to the ravages of time, the ever changing landscape has engulfed and buried access to the main temple grounds in the seabed.  As fate would have it, archaeologists discovered this pronaos which is made accessible through a little opening in the nearby cave structure.\\n\\nEngineers are currently determining whether this section of the temple is salvageable.  Despite these ruins being declared unstable, they do attract the occasional brave visitor and student of history.  \\n\\nWe may never fully know to whom this temple was dedicated, but rumour has it that the Great Khunzar-ri took refuge here from time to time.\\n\\nTotes 1, August 2021',['title']='Submerged Temple Ruin',},['SizeZ']=30,['SizeY']=30,['Roll']=0,['Color']=929979,['Yaw']=4.799655,['Alpha']=1,['Z']=24216.961440,['X']=19525.442527,['Groups']=0,},},['TS']=1633771495,}"
