R["oh__@totes1"]="{['na']={[48]={['N']='St Alessia\\'s Sanctum',['O']=18867,},[41]={['N']='Azura\\'s Sanctuary',['O']=18890,['C']=1.037000,['D']='Azura’s Sanctuary is a peaceful retreat from the hustle and bustle of Tamriel. Crystal murals adorn her shrine and can also be found throughout the grounds. There are many areas to rest and contemplate. A library is available to help with your meditations and musings.  If you have any questions, speak to the Acolyte who looks after the site over at the Visitor’s Centre and office. \\n(*Note: if crystals are flickering, switching off multithread rendering in video options can help).',},[59]={['N']='Alinor Crest Mews',['O']=18543,},[68]={['N']='Rimmen Inn',['O']=18453,},[13]={['N']='Submerged Temple',['O']=18853,['C']=1.500000,['D']='Submerged temple ruin',},[62]={['N']='Smoke & Mirrors',['O']=18876,['C']=1.003000,['D']='Welcome to the Psijic Gallery’s latest exhibition – an installation maze titled ‘Smoke & Mirrors’.  The exhibition celebrates the timeless beauty of the Constellation Tiles while playing with the deception they artfully hide beneath their surface.  Be sure to read the artist’s statement while helping yourself to a victorious sweetroll.\\r\\n\\r\\n(Re-published to fix some EHT effects)\\r',},[70]={['N']='Lunar Mausoleum',['O']=18897,['C']=1.029000,['D']='Mausoleum of Lunar Champions. Welcome to the final resting place of Khunzar-ri the Lunar Champion, and his decedents. After paying your respects to this illustrious Khajiit lineage, you are invited to enjoy the courtyard grounds of Moongrave Fane. This ancient monastery remains in operation. While outsiders are not admitted into the main temple, the famous Ethereal Library is open to all visitors who wish to commune with the spirit realms.\\r\\n\\n(An updated iteration of a previous build).\\r',},},['Version']=1762,['TS']=1632745280,['Key']='oh__@totes1',}"
