R["fx__na__@totes1__62"]="{['TS']=1631072319,['Version']=1760,['Effects']={[1]={['MetaData']={['message']='\"Just as the Constellation Tiles hide a mystery beneath their surface, so too we are not the avatars we play, but rather the light that shines through them.  Everything else is merely smoke and mirrors.\"\\n\\n\\'Smoke & Mirrors\\' is an installation maze that celebrates both the classic beauty of Constellation Tiles and the deception that they so artfully hide. It is a reminder that wonder and mystery are often found beneath the surface of things.\\n\\nWe are never truly alone in our journeys, nor are our accomplishments achieved in a vacuum.  This project was realised through the generous assistance of @Gorak60 with his masterful guidance on lighting and @AliToups with her technical expertise. My thanks to both for their stylistic input which has helped to perfect this build. \\n\\n@Totes1 - Sep 2020',['title']='Smoke & Mirrors',},['SizeZ']=30,['SizeY']=30,['Alpha']=1,['Color']=994229,['Groups']=0,['Yaw']=1.570796,['Roll']=0,['Pitch']=4.712564,['Id']=1058,['X']=64724,['Contrast']=1,['Z']=68217,['SizeX']=26.456456,['Y']=7136,['EffectType']=8503,},[2]={['SizeZ']=100,['SizeY']=100,['Alpha']=1,['Color']=494949,['Groups']=0,['SizeX']=100,['Roll']=0,['Pitch']=0,['Id']=1061,['X']=0,['Contrast']=1,['Z']=0,['Yaw']=0,['Y']=0,['EffectType']=614,},[3]={['MetaData']={['title']='Smoke & Mirrors',},['SizeZ']=100,['SizeY']=100,['Alpha']=1,['Color']=999999,['Groups']=0,['Yaw']=0,['Roll']=0,['Pitch']=0,['Id']=1062,['X']=76143,['Contrast']=1,['Z']=66366,['SizeX']=100,['Y']=11959,['EffectType']=595,},},}"
