R["fx__eu__@thepsychoticaltmer__80"]="{['Version']=1759,['TS']=1630705320,['Effects']={[1]={['EffectType']=15,['Roll']=0,['Y']=27072,['Groups']=0,['Yaw']=0,['Pitch']=0,['SizeX']=166378,['Alpha']=1,['Contrast']=1,['Color']=996752,['SizeZ']=156360,['Z']=100526.508425,['X']=116716.918474,['Id']=1110,['SizeY']=156360,},[2]={['EffectType']=8503,['Roll']=0,['Y']=19595,['Contrast']=1,['MetaData']={['title']='Instructions for Solvent Production',['message']='The Dwemer are proving remarkably resistant to force: those we have lashed and put against the rack remain ever as tight-lipped, and I suspect it will be many more weeks before we can break their collective will: the Calling is proving to be an interesting beast to crack. It seems the weaker links who would have otherwise given in to our questioning are given solace in a shared communication with others in the same predicament. It\\'s a miracle we managed to sever them as much as we did, otherwise it seems likely that our coup would have been reported to the other cities.\\n\\nRegardless, we managed to extract something: perhaps you and Gwenaine can put it to use?\\n\\nHere are a few of the recipes for making solvents. Do note that these are order-specific, so make sure they are made exactly as written. I don\\'t want a repeat of what happened at Moesring (and tell Gwenaine she still owes me a bottle of wine):\\n\\n--------------------------------------------------------------\\n\\n1 Green + 1 Red + 1 Blue = Generic Base\\n\\n1 Red + 2 Blue = Electric Compound\\n\\n1 Green + 1 Red + 1 Green = Acidic Compound (exercise caution)\\n\\n2 Blue + 1 Red + 1 Green = Frost Compound\\n\\n--------------------------------------------------------------\\n\\n- Knight-Paladin Aedir',},['Yaw']=3.155555,['Pitch']=4.712564,['SizeX']=26.456456,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=107096.229413,['X']=109441.568758,['Id']=1114,['SizeY']=30,},[3]={['EffectType']=8,['Roll']=0,['Y']=19609,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=97,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=103776.635797,['X']=108830.760638,['Id']=1116,['SizeY']=17,},[4]={['EffectType']=8503,['Roll']=0,['Y']=19631,['Contrast']=1,['MetaData']={['title']='Notes on Extraction',['message']='*The writing here is strange. Everyone has a distinct way of writing: whether it be from the flowery, delicate verbage of an educated poet, or the rough-yet-warm penmanship of a commoner. There is none of that here: each letter is a uniform, soulless imprint upon the page which gives no clues as to anything regarding the author: man or woman, young or old, expert or novice. Not even a flicker of personality remains in the cold, hard etchings of fact upon this page*\\n\\n--------------------------------------------------------------\\n\\nON QUANTITY: We have a fairly limited stock, which posits a potential obstabcle: we cannot collect materials from the other Dwemeri city-states without compromising the nature of our control here, and we cannot leave this place without invoking the wrath of the Northern barbarians. Thus we must make do with the surplus readily available to us. \\n\\nIn order to ensure future viability, we must exercise prejudice in our selection process. We should limit our experiments to the older stock.\\n\\n--------------------------------------------------------------\\n\\nON QUALITY: Preliminary research indicates our materials will require a significant investment of time to replenish to a satisfactory quality. Whilst we have ran our tests on the debased stock, there will come a clear point where we will have plumbed their worth. \\n\\nPeak status is within the range of 18-21 years. Aedir has already begun creating more for our army, we will take the lesser scraps not fit for purpose. Until then, it is my suggestion that we limit our usage to a ratio of 1:4 with the variables being Specimen/Week. \\n\\nTo preserve longetivity, we will also limit monthly extraction limits to 1x10^5  (5 Barrels).\\n\\n---------------------------------------------------------------',},['Yaw']=2.010619,['Pitch']=0,['SizeX']=26.456456,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=104975.100212,['X']=107256.533734,['Id']=1125,['SizeY']=30,},[5]={['EffectType']=8503,['Roll']=0,['Y']=19767,['Contrast']=1,['MetaData']={['title']='Locked Closet',['message']='A locked, brass closet. Like all things crafted with Dwemer metal, it shows very little signs of aging: even the lock itself is in perfect condition, allowing anyone with knowledge of Dwemer design or lockpicking to break in.\\n\\n---------------------------------------------------------------------------------',},['Yaw']=6.014405,['Pitch']=0,['SizeX']=26.456456,['Alpha']=0,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=104921.053398,['X']=108692.189824,['Id']=1127,['SizeY']=30,},[6]={['EffectType']=8,['Roll']=0,['Y']=19633,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=95,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=104970.866313,['X']=107272.964275,['Id']=1128,['SizeY']=17,},[7]={['EffectType']=8503,['Roll']=3.141767,['Y']=19547,['Contrast']=1,['MetaData']={['title']='Alchemical Rack',['message']='There are 4 vials sitting in the rack, each with a different liquid in varying hues from a deep, muted orange, to a pearly-white milk. They are labelled as follows, from top to bottom:\\n\\nCondensed Flame\\nTone-Altered Dwemeri Oil\\nEssence of Valeflower\\nCongealed Animus Paste',},['Yaw']=2.007129,['Pitch']=1.570971,['SizeX']=26.456456,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=104245.410008,['X']=107462.202930,['Id']=1129,['SizeY']=30,},[8]={['EffectType']=8503,['Roll']=3.141767,['Y']=19545,['Contrast']=1,['MetaData']={['title']='Ornate Phial',['message']='The phial is topped with silver: inlaid, intricate markings of eagles and snowflakes ring around in an exquisite show of craftsmanship and opulence. The glass is shimmering, iridescent viridian, and inside is a viscous material that adds a surprising weight to the phial if it is held in-hand. There is a single label: \\n\\n\"Fulminating Liquid Gold\"',},['Yaw']=5.148721,['Pitch']=4.799655,['SizeX']=26.456456,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=104285.080176,['X']=107434.163397,['Id']=1130,['SizeY']=30,},[9]={['EffectType']=8503,['Roll']=0,['Y']=19691,['Contrast']=1,['MetaData']={['title']='On the Nature of Shadow',['message']='* This book is significantly worn out, with numerous page corners being bent over. There is even a bookmark still left inside. This book was read extensively, to the point of obsession*\\n\\n--------------------------------------------------------------\\n\\nA treatise written by Maraithbor, Senior Curate of the Chantry of Auri-El.\\n\\nIf you were to ask ten common Mer the question: \"What is a shadow?\", you\\'d get 50 answers back.\\n\\nTo some, it is a source of terror: how many of our people fear the foul creatures of the night, or petty banditry from the lesser of our kin? for some unscrupulous Falmer, it is a source of opportunity: a way to hide, a place to plot and a means of secrecy. A child fears the shadow under their bed, just as two forbidden lovers crave the unjudging privacy of shadow.',},['Yaw']=1.752311,['Pitch']=0,['SizeX']=26.456456,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=105029.047711,['X']=107277.331219,['Id']=1131,['SizeY']=30,},[10]={['EffectType']=8501,['Roll']=0,['Y']=19568,['Contrast']=1,['MetaData']={['title']='Soul Gem Pile',['message']='A medium gear would be found without much hassle:\\n\\nPerhaps there are other things to find?\\n\\nROLLS:\\n\\n- Roll 60+ to find something (1d100)\\n- If successful, roll again (3d4)\\n\\n1-4 = Low-tier reward\\n5-9 = Medium-tier reward\\n10-11 = High-tier reward\\n12 = Legendary reward\\n\\nWhisper me (@thepsychoticaltmer) so I can DM your reward!\\n\\n(ONE PERSON ONLY)',},['Yaw']=2.453933,['Pitch']=0,['SizeX']=22,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=103002.725424,['X']=107922.941926,['Id']=1133,['SizeY']=30,},[11]={['EffectType']=8502,['Roll']=3.141767,['Y']=19603,['Contrast']=1,['MetaData']={['title']='The New Falmer Empire!',['message']='\\nVICTORY!\\n\\nWe have prevailed against vile treachery, and once again sit the throne of this land that is our home!\\n\\nWe drove those who came from across the sea back to their blighted homeland, lest their fumbling hands drive us all into ruin. Upon their return, with dark arts and cruelty unmatched, they toppled millenia of culture and history: a force of Five-Hundred Demons who devoured all we held dear.\\n\\nIn desperation after our final loss, we turned to the Dwemer here: who would have finished our people off with the same cruelty, deceit and barbarity that they condemn the Ash-Kin of Resdayn for.\\n\\nWe caught on to this plan, and through superior wit and spirit, have struck down the Mage-Architects. The corpses of their soldiers and craftlords shall feed our plants, and their brass-heart creations now serve us.\\n\\nTo all Dwemer reading this: comply with our new Empire, and join us in rebuilding what the Falmer once were, and you will reap the benefits. Resist, and you will understand the reason why your Lords had you hide in the mountains and caves under OUR Land.\\n\\n--------------------------------------------------------------\\n\\n*The person who received this particular copy of the declaration seems to have not taken it particularly seriously: drawing an arrow from the bottom of the text towards a very amusingly realistic rendition of fecal matter in bright, blue ink*',},['Yaw']=5.134759,['Pitch']=1.570971,['SizeX']=24.456456,['Alpha']=0.060000,['Groups']=0,['Color']=102439,['SizeZ']=26,['Z']=107136.842773,['X']=109384.616960,['Id']=1134,['SizeY']=26,},[12]={['EffectType']=8,['Roll']=0,['Y']=19629,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=97,['Alpha']=1,['Contrast']=1.740000,['Color']=993