2,['X']=109565.521555,['Id']=1142,['SizeY']=30,},[20]={['EffectType']=8,['Roll']=0,['Y']=19728,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=95,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=103243.974550,['X']=107837.370495,['Id']=1143,['SizeY']=17,},[21]={['EffectType']=8,['Roll']=0,['Y']=19695,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=95,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=105016.234370,['X']=107294.891242,['Id']=1144,['SizeY']=17,},[22]={['EffectType']=8501,['Roll']=0,['Y']=19728,['Contrast']=1,['MetaData']={['title']='Large Gear',['message']='The gear seems to holding the chain down, for whatever reason',},['Yaw']=2.453933,['Pitch']=0,['SizeX']=22,['Alpha']=1,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=103221.375727,['X']=107849.801870,['Id']=1145,['SizeY']=30,},[23]={['EffectType']=8503,['Roll']=0,['Y']=19767,['Contrast']=1,['MetaData']={['title']='Schematics',['message']='These complex diagrams assume the reader is skilled in understanding Dwemer technology and mechanics: because it certainly makes no effort to explain the details to those who don\\'t. A particularly perceptive layman might notice that the circular shape within the diagram resembles the sphere hanging above, but nothing more.',},['Yaw']=4.356342,['Pitch']=0,['SizeX']=26.456456,['Alpha']=0,['Groups']=0,['Color']=102439,['SizeZ']=30,['Z']=105152.073414,['X']=108748.229813,['Id']=1146,['SizeY']=30,},[24]={['EffectType']=8,['Roll']=0,['Y']=19588,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=95,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=103030.095352,['X']=107886.477075,['Id']=1147,['SizeY']=17,},[25]={['EffectType']=8,['Roll']=0,['Y']=19544,['Groups']=0,['Yaw']=3.054326,['Pitch']=0,['SizeX']=95,['Alpha']=1,['Contrast']=1.740000,['Color']=993836,['SizeZ']=17,['Z']=103895.422847,['X']=108934.591190,['Id']=1148,['SizeY']=17,},[26]={['EffectType']=8502,['Roll']=0,['Y']=19595,['Contrast']=1,[